#keluargaMAWARDI “Selamat Hari Ayah untuk ayah seluruh Indonesia. Bersama seorang ibu, kalian adalah pilar peradaban sebuah bangsa." Ayah adalah pendamping ibu yang merupakan pilar dan landasan sebuah bangsa. Tanpa ayah dan ibu tidaklah tercipta Kita. Kita sebagai generasi penerus bangsa diciptakan dari seorang ayah yang rela berkorban dan berusaha sepenuh hati untuk anaknya.

